    /**
     * @param string $str
     * @param bool $quan_pin    
     * @param bool $to_upper    
     * @return string
     */
    public function getpy($str = '', $quan_pin = true, $upper = false)
    {
        if (!is_string($str) || $str == '') {
            return '';
        }

        $pattern = "/\s/is";
        $str = preg_replace($pattern, "_", $str);

        $pattern = "/(|\~|\`|\!|\@|\#|\$|\%|\^|\&|\*|\(|\)|\-|\+|\=|\{|\}|\[|\]|\||\\|\:|\;|\"|\'|\<|\,|\>|\.|\?|\/)/is";
        $str = preg_replace($pattern, "", $str);

        //UTF-8
        if (strlen("") > 4) {
            $str = iconv('UTF-8', 'GBK', $str);
        }

        $py = '';
        for ($i = 0; $i < strlen($str); $i++) {
            if (ord($str[$i]) > 128) {
                $char = self::asiToPy(ord($str[$i]) + ord($str[$i + 1]) * 256);
                $py .= $quan_pin ? $char : $char[0];    //
                $i++;
            } else {
                $py .= $str[$i];
            }
        }

        return ($upper ? $py : strtolower($py));
    }

    /**
     * @param $a
     * @return int|string
     */
    protected function asiToPy($a)
    {
        $py = $this->pinyin;
        foreach ($py as $k => $p) {
            if (array_search($a, $p) !== false) {
                return $k;
            }
        }
    }
